import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        Sarcasm Detector
      </header>
      <div>
        <input type='text' name='title' value={this.state.title}
          onChange={this.handleChange.bind(this)} />
      </div>
    </div>
  );
}

export default App;
